import React from 'react'
import { Card, Form, Typography } from 'antd'

const { Title } = Typography

function APR() {
    return (
        <Card>
            <Form.Item justify="center" style={{ textAlign: 'center' }}>
                <Title level={1}>Agent Productivity Report</Title>
            </Form.Item>
		</Card>
    )
}

export default APR
